import React, { Component } from 'react';

class AddUser extends Component {

    componentDidMount() {
        document.title = 'Add User';
    }
    render(){
        return(

            <div className="container">
                <div className="jumbotron">
                    <h1 className="text-center">Add User</h1>
                </div>
                <UserForm />
            </div>
        );

    }
}

class UserForm extends Component {
    render() {
        return (
            <div>
                <div>
                    <label >Name:</label>
                    <input type="text" className="form-control" placeholder="Enter your name"></input>
                </div>
                <div>
                    <label>Age:</label>
                    <input type="number" className="form-control" placeholder="Enter your age"></input>
                </div>
                <div>
                    <button type="submit" className="btn btn-success" style={{borderRadius:15}}>Submit</button>
                </div>
            </div>
        );
    }
}

export default AddUser;
